import base64
import re
import os
import shutil

# 全局参数
imagedir = './'

# 控制参数
error = 0
start_time = None
limit_time = 2  # 1 秒

action_list = ['blink', 'open_mouth', 'emotion', 'rise_head', 'bow_head',
               'look_left', 'look_right']



def facecollecting(id, type, list):

    if type == 'old_people':
        id = '1_' + id
    elif type == 'volunteer':
        id = '2_' + id
    elif type == 'employee':
        id = '3_' + id
    else:
         pass

    #新建目录
    if os.path.exists(os.path.join(imagedir, id)):
        shutil.rmtree(os.path.join(imagedir, id), True)
    os.mkdir(os.path.join(imagedir, id))
    i = 0
    for image in list:
        # str = "data:image/jpeg;base64,"
        mystr = image
        result = re.search("data:image/(?P<ext>.*?);base64,(?P<data>.*)", mystr, re.DOTALL)
        if result:
            ext = result.groupdict().get("ext")
            data = result.groupdict().get("data")
        imgdata = base64.b64decode(data)
        file = open(os.path.join(imagedir, id) + '/' + str(i) + '.' + ext, 'wb')
        file.write(imgdata)
        file.close()
        i += 1
        # image_name = os.path.join(args['imagedir'], args['id'],
        #                       action + '_' + str(counter) + '.jpg')
        file = open(os.path.join(imagedir, id)+'/' + str(i) + '.' + ext, 'wb')
        file.write(imgdata)
        file.close()
        i += 1


if __name__ == '__main__':
    astr = "data:image/jpeg;base64,"
    list = []
    list.append(astr)
